import { useEffect, useState } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";
import Roster from "./views/Roster";

function App() {
  useEffect(() => {
    console.log("loaded");
  }, []);

  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={Roster} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
